Love Exercise Science? Major in Nutrition! 
@uconn_nutrition UConn Nutritional Sciences offers a minor in Exercise and Sport. Fuel performance, optimize recovery, and boost health with a Nutrition degree! Learn the science behind metabolism, sports nutrition, and dietary strategies for peak performance. Open doors to careers in sports dietetics, strength & conditioning, and health coaching.
